import React from "react";
import { Link } from "react-router-dom";
import Header from '../components/Header';
import Carousel from '../components/Carousel';
import Footer from '../components/Footer';


function Home() {
  return (
    <div>
      <Header />
      <Carousel />
      <Footer />
    </div>
  );
}

export default Home;
